import React from "react";

type Props = {
	title: string;
	description: string;
	image?: string;
	initial_date?: string;
	final_date?: string;
};

const Project: React.FC<Props> = ({ ...props }) => {
	return (
		<div>
			<p>{props.title}</p>
			<p>{props.description}</p>
		</div>
	);
};

export default Project;
